import { Button } from "./ui/button";

export function RestaurantCard({ name, logo, logoColor }) {
  return (
    <div className="bg-white rounded-lg p-6 flex flex-col items-center gap-4 shadow-sm">
      <div 
        className="w-full aspect-video rounded flex items-center justify-center"
        style={{ backgroundColor: logoColor }}
      >
        <div className="text-6xl">{logo}</div>
      </div>
      
      <h3 className="text-black uppercase">{name}</h3>
      
      <Button 
        variant="outline" 
        className="w-full border-black text-black hover:bg-gray-100"
      >
        VIEW MENU
      </Button>
    </div>
  );
}
